import './App.css';
import React from 'react'

class City_illustration extends React.Component{
    constructor(props)
    {
        super(props);
        this.state = {path : ""};
    }

    static getDerivedStateFromProps(props, state) {
        return {path: props.path};
    }

    render(){
        return(
            <div>
                {console.log(this.state.path)}
                <img src={this.state.path}> alt="" </img>
            </div>
        )
    }
}

export default City_illustration;
